eventList.script:
// 事件参数： 页面组件props object, 需要结合具体场景来确认对象的信息;
const props = '${props}';
const now = new Date();

const y = now.getFullYear();
const m = String(now.getMonth() + 1).padStart(2, '0');
const d = String(now.getDate()).padStart(2, '0');

const startOfDayStr = y + "-" + m + "-" + d + " 00:00:00"
const param130 = [{
    items:[{
        items:[
            {
              var: "changedCompletionTime",
              compare: "30",
              values: [
                startOfDayStr
              ]
            },
            {
              join: "OR",
              items: [
                {
                  var: "changedCompletionTime",
                  compare: "90"
                },
                {
                  var: "plannedEndTime",
                  compare: "30",
                  values: [
                    startOfDayStr
                  ]
                }
              ]
            }
        ]
    }]
}]

renderEngine.getInstance('KObjectTableWrapper-243').setConditionItem(param130);

const selectRows = renderEngine.getInstance('KObjectTableWrapper-243').getSelectedRows();// 组件操作语句:弹窗5362执行显示弹窗;
if (selectRows.length > 0) {
    renderEngine.getInstance('modal_5362').show();
} else {
    // 弹窗信息
    showNotification({
        type: 'warning',
        title: '请选择数据',
        content: '',
        detailContent: ''
    })
}

// 组件操作语句:对象表格243执行获取选中行;
const selectRows = renderEngine.getInstance('KObjectTableWrapper-243').getSelectedRows();
//获取表单数据
const formValue = renderEngine.getInstance('DynamicForm-5365').getValue();
//获取变更后完成时间
const changedTime = formValue['changedTime']

//记录不符合条件的数据
const errorData = []
selectRows.forEach(item => {
    if (changedTime < item.plannedEndTime || changedTime < item.changedCompletionTime) {
        errorData.push(item)
    }
})
if (errorData.length > 0) {
    const errCode = errorData.map(x => x.code).join(',')
    const msg = errCode + '以上订单更新失败，请检查'
    // 弹窗信息
    showNotification({
        type: 'error',
        title: '更新失败',
        content: '变更完成时间失败',
        detailContent: msg
    })
    return false
}

const now = new Date();

const y = now.getFullYear();
const m = String(now.getMonth() + 1).padStart(2, '0');
const d = String(now.getDate()).padStart(2, '0');

const h = String(now.getHours()).padStart(2, '0');
const min = String(now.getMinutes()).padStart(2, '0');
const s = String(now.getSeconds()).padStart(2, '0');

const newtime = y + '-' + m + '-' + d + " " + h + ":" + min + ':' + s
const currentInfo = JSON.parse(localStorage.getItem('km-userInfo'))
const userId = currentInfo.userId
const saveParams = selectRows.map(x => {
    return {
        id: x.id,
        entityType: x.entityType,
        changedCompletionTime: formValue['changedTime'],
        adjuster: { id: userId, entityType: "User", code: null, name: null },
        adjustTime: newtime
    }
})
// API调用模板
requestHostApi({
    url: '#{dev_runtime_api_host}/v1/dm/manage/batchUpdate',
    method: 'POST',
    data: {
        object: saveParams
    }
}).then(res => {
    if (res.code === 0) {
        // 弹窗信息
        showNotification({
            type: 'success',
            title: '修改成功',
            content: '',
            detailContent: ''
        })
        //修改成功之后插入生产计划时间调整关系表
        const insertRow = selectRows.map(item => {
            return {
                entityType: 'HxProdOrderAdjustLink',
                source: { id: item.id, entityType: item.entityType },
                adjustReason: formValue['reason'],
                adjustBeforeTime: item.changedCompletionTime,
                adjustAfterTime: formValue['changedTime']
            }
        })
        // API调用模板
        requestHostApi({
            url: '#{dev_runtime_api_host}/v1/dm/manage/batchInsert',
            method: 'POST',
            data: {
                object: insertRow
            }
        }).then(res => {
            if (res.code === 0) {
                // 弹窗信息
                showNotification({
                    type: 'success',
                    title: '添加成功',
                    content: '',
                    detailContent: ''
                })
                renderEngine.getInstance('modal_5362').hide();
                renderEngine.getInstance('KObjectTableWrapper-243').refresh();
            } else {
                // 弹窗信息
                showNotification({
                    type: 'error',
                    title: '添加失败',
                    content: res.msg,
                    detailContent: res.msg
                })
            }
        }).catch(err => {
            // 处理错误
            console.error('API调用失败:', err);
        });

    } else {
        // 弹窗信息
        showNotification({
            type: 'error',
            title: '修改失败',
            content: res.msg,
            detailContent: res.msg
        })
    }
}).catch(err => {
    // 处理错误
    console.error('API调用失败:', err);
});
